Made it to Uluru just in time for sunset! Photos don't do its size justice but it makes all the long hours on the road worth it. Tomorrow I'll be back for sunrise and tonight I'm sleeping under the stars

@southaustralia 
@backpackersworld

Uluru is incredible by day but even more stunning under the stars. I've always wanted to shoot the night sky and the stars but never had the opportunity. There's no better place to do it and get better at it than the Northern Territory. 
@southaustralia 
@backpackersworld

Another early morning and another beautiful sunrise in Kata Tjuta. After the sunset we hiked the Valley of the Winds. The full circuit is 7.4km and takes about 3.5 hours if you enjoy the walk. 
@southaustralia 
@backpackersworld

This morning I walked the 10 km loop around the base of Uluru. This is the best way to see the Rock up close and in a respectful way. You are permitted to climb it but don't do it if you have any respect for Aboriginal culture and Tjukurpa (traditional law). People still continue to climb it (and have died) but it's a clear act of disrespect. Enjoy Uluru by walking the around the base at sunrise and respect the local culture 
@southaustralia 
@backpackersworld

Last night was the end of my overland tour from Melbourne to Alice Springs and this past week couldn't have been any better. Met awesome new people from around the world and can't wait to come back to see more of South Australia and the NT another time. Now it's back to Sydney!

@southaustralia 
@backpackersworld

The fog lifted just as I arrived at London Bridge this morning. It was worth the 5am wake up call today to have this view all to ourselves at sunrise. It's now known as London Arch after it collapsed in 1990 but it's just as stunning as ever to see in person 
Many of the Apostles have collapsed over the years and they'll continue to erode beyond the remaining 8 that stand today 
@backpackersworld @groovygrapetours

It may be an everyday sight for locals but I can't get enough of the wallabies, kangaroos, koalas and other awesome wildlife in Australia. Tomorrow the South Australia road trip continues as I make may way towards Alice Springs 
@southaustralia 
@backpackersworld

Making our way north into Outback from Adelaide we made a quick stop in Port Germein. There is an awesome 1,500 meter dock that extends into the ocean and a great place to spot sharks, dolphins, and sting rays

@southaustralia 
@backpackersworld

This was the view from my sleeping bag last night under the Australian night sky. I slept in a swag which essentially is an open air sleeping bag with a full view of the stars. This is the first time I've camped without sleeping inside a tent or something over my head but it won't be my last. The open air view of the night sky is incredible and as long as the dingos don't steal your boots you're all good 
@southaustralia 
@backpackersworld

I slept underground last night in Coober Pedy. The couple of thousand people that call it home build their homes underground in dugouts to avoid the intense daytime heat on the surface

And this was the sunrise this morning over Coober Pedy. 846 kilometres north of Adelaide you'll find this little minding community in the middle of nowhere. It's also known as the Opal capital of the world since it was discovered there in 1915

If you're making your way to Uluru through South Australia Coober Pedy is a really interesting place to stop on your road trip 
@southaustralia 
@backpackersworld

Overland across South Australia! There's no better way to see a country than by driving across it. Just got to watch for kangaroos on the road! We're making our way to King's Canyon today and into the Northern Territory. 
@southaustralia 
@backpackersworld

View from my swag under the stars right now in the Northern Territory. Already saw some dingoes around camp but they seem pretty friendly. I've never seen the stars like this before and it sure beats my views in Brooklyn. Now for bed before a big morning hike in Kings Canyon. 
