Today is my last day home in New York for a couple of weeks. I have to make the most of this beautiful day! Any suggestions?

Tomorrow I'm off to Nantucket and my summer travel schedule really takes off. From there I'll be headed to the lake in MN, Alaska, and eventually Cape Cod and down the East Coast. Summer travel for me is always about friends and family and I take a break from solo adventures. It's the only time of year I get to return to favorite places and continue traditions. 
